import React from 'react';
import { Route } from 'react-router-dom';
import EmptyTeam from './EmptyTeam';
import TeamGrid from './TeamGrid';
import SearchHero from '../search/SearchHero';
import './Home.css';

const Home = () => {
  const superherosList = [];

  let content = superherosList.length > 0 ? <TeamGrid /> : <EmptyTeam />;

  return (
    <section
      style={{ height: '100vh' }}
      className='d-flex mt-5 justify-content-center'
    >
      <div
        class='d-flex flex-column align-items-center alert alert-primary w-50 h-50 p-3'
        role='alert'
      >
        {content}
      </div>

      <Route path='/home/search'>
        <SearchHero />
      </Route>
    </section>
  );
};

export default Home;
